import React, { Component } from 'react';
import Input from './Input';

class Education extends Component {
    render() {
        const { changeSchool, changeEducationCity, changeSubject, changeStartEducation, changeEndEducation, edit } = this.props;
        const { school, city, subject, from, to } = this.props.state;
        return (
            <fieldset>
                <legend>Education</legend>
                <Input name="School Name" onChange={changeSchool} edit={edit} value={school}/>
                <Input name="City" onChange={changeEducationCity} edit={edit} value={city}/>
                <Input name="Subject" onChange={changeSubject} edit={edit} value={subject}/>
                <Input name="From" onChange={changeStartEducation} edit={edit} value={from}/>
                <Input name="To" onChange={changeEndEducation} edit={edit} value={to}/>
            </fieldset>
        )
    }
}

export default Education;
